import React from 'react';
import { NavLink } from 'react-router-dom';
import { useState, useEffect } from 'react';
import moment from 'moment'



const Order = () => {
    const [orderData, setOrderData] = useState({});
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // Use the URL of your JSON data
        fetch('http://localhost:3000/checkoutDetails')
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setOrderData(data[1]);
                setLoading(false);
            })
            .catch((error) => {
                console.error('Error fetching data: ', error);
                setLoading(false);
            });
    }, []); // The empty array means this effect runs once when the component mounts

    if (loading) {
        return <div>Loading...</div>;
    }

    
    const order= (rest) => {
        console.log(rest, 'gggggggggg')
        return(
            <>
                
                <div className="px-4 my-5 bg-light rounded-3 py-5">
                <div className="container py-4">
                    <div className="row justify-content-center">
                        <div className="col-md-4">
                            <img src={rest.url} alt={rest.foodName} height="200px" width="180px" />
                        </div>
                        <div className="col-md-4">
                            <h3>{rest.foodName}</h3>
                            <p className="lead fw-bold">
                                {rest.qty} X ${rest.price} = ${rest.qty * rest.price}
                            </p>
                            <div className="col-md-4">
                            <h3>{orderData.foodName}</h3>
                            <p>ID: {orderData.orderid}</p>
                            <p>Name: {orderData.Firstname}</p>
                            <p>Date: <b>{moment().format('Do MMMM YYYY')}</b></p>
                            <p>Time: <b>{moment().format('h:mm:ss a')}</b></p>
                            <p>Address: {orderData.address.street}</p>
                        </div>
                        </div>
                    </div>
                </div>
            </div>
            
            </>
            
        )

    }
   

    
}

export default Order;
